INSERT INTO `page` (`id`, `contenu`, `date_creation`, `titre`, `date_modification`, `modifier_par`, `keyword`, `nbre_mod`, `doc`, `img1`, `img2`, `img3`, `img4`, `id_utilisateur`) VALUES
(1201, '<p>&nbsp;</p>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; box-sizing: border-box; margin: 20px 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(154, 79, 149); font-weight: bold; font-size: 18.62px; line-height: 1.5em; clear: right;\">Les m&eacute;ningites dues &agrave; des virus</h2>\r\n\r\n<p style=\"font-family: Arial, sans-serif; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; vertical-align: baseline; font-size: 14px; clear: none; color: rgb(68, 68, 68);\">Les m&eacute;ningites virales, qui sont les plus fr&eacute;quentes (70 &agrave; 80 % des cas), sont g&eacute;n&eacute;ralement b&eacute;nignes. La gu&eacute;rison survient en cinq &agrave; dix jours, mais des maux de t&ecirc;te peuvent persister plusieurs semaines. Les m&eacute;ningites virales ont des origines vari&eacute;es : virus de la famille des Ent&eacute;rovirus, virus de la&nbsp;<a href=\"https://eurekasante.vidal.fr/maladies/chez-les-enfants/varicelle.html\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(51, 51, 51); outline: 0px; line-height: inherit; clear: none;\">varicelle</a>, de la mononucl&eacute;ose infectieuse, de la&nbsp;<a href=\"https://eurekasante.vidal.fr/maladies/chez-les-enfants/rougeole.html\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(51, 51, 51); outline: 0px; line-height: inherit; clear: none;\">rougeole</a>, des&nbsp;<a href=\"https://eurekasante.vidal.fr/maladies/chez-les-enfants/oreillons.html\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(51, 51, 51); outline: 0px; line-height: inherit; clear: none;\">oreillons</a>, de la grippe ou de l&rsquo;herp&egrave;s (qui provoque les m&eacute;ningites virales les plus graves), etc.</p>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; box-sizing: border-box; margin: 20px 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(154, 79, 149); font-weight: bold; font-size: 18.62px; line-height: 1.5em; clear: right;\">Les m&eacute;ningites dues &agrave; des bact&eacute;ries</h2>\r\n\r\n<p style=\"font-family: Arial, sans-serif; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; vertical-align: baseline; font-size: 14px; clear: none; color: rgb(68, 68, 68);\">Les m&eacute;ningites bact&eacute;riennes mettent la vie du patient en danger. Elles n&eacute;cessitent une prise en charge m&eacute;dicale urgente.</p>\r\n\r\n<p style=\"font-family: Arial, sans-serif; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; vertical-align: baseline; font-size: 14px; clear: none; color: rgb(68, 68, 68);\">Plusieurs types de bact&eacute;ries peuvent &ecirc;tre &agrave; l&rsquo;origine de m&eacute;ningites :</p>\r\n\r\n<ul class=\"tiret\" style=\"font-family: Arial, sans-serif; box-sizing: border-box; margin: 12px 20px 16px 0px; padding-right: 0px; padding-left: 0px; border: 0px; vertical-align: baseline; list-style: none outside; clear: none; font-size: 14px; color: rgb(68, 68, 68);\">\r\n	<li style=\"box-sizing: border-box; margin: 0px 0px 6px; padding: 0px 0px 0px 2px; border: 0px; vertical-align: baseline; line-height: 18px; list-style-image: url(&quot;../imgs/tiret.png&quot;); list-style-position: inside; clear: none; font-size: 1em;\">Le&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; clear: none;\">pneumocoque</b>&nbsp;(<i style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; clear: none;\">Streptococcus pneumoniae</i>) est le plus fr&eacute;quent (environ la moiti&eacute; cas de m&eacute;ningite bact&eacute;rienne en France). Cette bact&eacute;rie se d&eacute;veloppe dans le nez et la gorge (rhinopharynx) o&ugrave; elle peut rester plusieurs mois sans provoquer de sympt&ocirc;mes (c&rsquo;est ce qu&rsquo;on appelle le &laquo; portage sain &raquo;). Parfois, sans que l&rsquo;on en sache les m&eacute;canismes, ce pneumocoque provoque des otites, une pneumonie, une m&eacute;ningite voire une septic&eacute;mie (infection g&eacute;n&eacute;ralis&eacute;e).</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px 0px 6px; padding: 0px 0px 0px 2px; border: 0px; vertical-align: baseline; line-height: 18px; list-style-image: url(&quot;../imgs/tiret.png&quot;); list-style-position: inside; clear: none; font-size: 1em;\">Le&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; clear: none;\">m&eacute;ningocoque</b>&nbsp;(<i style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; clear: none;\">Neisseria meningitidis</i>) est responsable d&rsquo;environ un quart des cas de m&eacute;ningite bact&eacute;rienne en France. Comme le pneumocoque, cette bact&eacute;rie se d&eacute;veloppe dans le nez et la gorge o&ugrave; elle peut rester longtemps sans provoquer de sympt&ocirc;mes. Toutefois, chez certaines personnes, le m&eacute;ningocoque est &agrave; l&rsquo;origine d&rsquo;une m&eacute;ningite ou d&rsquo;une septic&eacute;mie.</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px 0px 6px; padding: 0px 0px 0px 2px; border: 0px; vertical-align: baseline; line-height: 18px; list-style-image: url(&quot;../imgs/tiret.png&quot;); list-style-position: inside; clear: none; font-size: 1em;\">Les&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; clear: none;\">streptocoques du groupe B</b>&nbsp;(en particulier&nbsp;<i style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; clear: none;\">Streptococcus agalactiae</i>) sont la cause d&rsquo;environ 10&nbsp;% des cas de m&eacute;ningite en France. Mais, chez les nouveau-n&eacute;s de moins de deux mois, cette bact&eacute;rie est responsable de pr&egrave;s de 80 % des m&eacute;ningites. Les femmes h&eacute;bergent fr&eacute;quemment cette bact&eacute;rie sur les parois du vagin (sans aucun sympt&ocirc;me) et il arrive que les nouveau-n&eacute;s soient contamin&eacute;s lors de l&rsquo;accouchement. Pour cette raison, il est recommand&eacute; aux femmes enceintes de r&eacute;aliser un pr&eacute;l&egrave;vement vaginal en fin de grossesse (au cours du neuvi&egrave;me mois), afin de rechercher la pr&eacute;sence de streptocoques B et de mettre en &oelig;uvre, si n&eacute;cessaire, un traitement antibiotique adapt&eacute; pendant l&rsquo;accouchement.</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px 0px 6px; padding: 0px 0px 0px 2px; border: 0px; vertical-align: baseline; line-height: 18px; list-style-image: url(&quot;../imgs/tiret.png&quot;); list-style-position: inside; clear: none; font-size: 1em;\">D&rsquo;autres bact&eacute;ries peuvent &eacute;galement &ecirc;tre &agrave; l&rsquo;origine de m&eacute;ningites : la<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; clear: none;\">&nbsp;listeria</b>&nbsp;(<i style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; clear: none;\">Listeria monocytogenes</i>),&nbsp;<i style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; clear: none;\">H&aelig;mophilus influenzae B</i>&nbsp;ou encore&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; clear: none;\">Mycobacterium tuberculosis</b>&nbsp;(la bact&eacute;rie responsable de la tuberculose).</li>\r\n</ul>\r\n', '2019-10-28 11:57:15', 'Quelques causes de la méningite', '2019-10-28 11:57:15', 2, 'bacteries,virus', 0, '', , , NULL, NULL, 2);
